import React, {useContext} from 'react';
import {Context} from "../index";
import { ListGroup } from 'react-bootstrap';
import {observer} from "mobx-react-lite";
import { Col } from 'react-bootstrap';

const TypePic = observer(() => {
    const {pic}=useContext(Context);
    return (
        <ListGroup className='mt-5'>
    <ListGroup.Item action variant="success">Ваши фото</ListGroup.Item>
    <ListGroup.Item  action variant="success">Популярные фото</ListGroup.Item>
    <ListGroup.Item  action variant="success">Фото ваших друзей</ListGroup.Item>
    <ListGroup.Item  action variant="success">Фото природы</ListGroup.Item>
  
    </ListGroup>
    );

});

export default TypePic;
